import React from 'react';
import { Button, Container, Nav, Navbar } from "react-bootstrap";
import { NavLink } from "react-router-dom";  // Это должно быть из react-router-dom, а не из react-bootstrap
import { observer } from "mobx-react-lite";
import {useNavigate} from "react-router-dom";
import {CREATEORDER_ROUTE, LOGIN_ROTE, MENU_ROUTE} from "../utils/const";

const MyNavBar = observer(() => {
    const history = useNavigate()
    return (
        <Navbar bg="dark" variant="dark">
            <Container>
                <NavLink style={{color:'white'}} to={MENU_ROUTE}>Menu</NavLink>
                <Nav>
                    <Button
                        style={{marginRight: 20}}
                        variant="outline-light"
                        onClick={() => history(LOGIN_ROTE)}
                    >
                        Login
                    </Button>
                    <Button
                        className="mr-3"
                        variant="outline-light"
                        onClick={() => history(CREATEORDER_ROUTE)}
                    >
                        Create order
                    </Button>
                </Nav>
            </Container>
        </Navbar>
    );
});

export default MyNavBar;
